        >
          <i class='fab fa-google'></i>
        </a>
      </div>
      <p className='my-2' style={{ color: 'rgba(90,77,16,0.25)' }}>
        Â© Copyrights preserved Sakalli
      </p>
    </div>
  </div>
);

export class Footer extends Component {
  render() {
    return (
      <div>
        <FooterDesign />
      </div>
    );
  }
}

export default Footer;
